import React, { Component } from "react";

// import logo from "./logo.svg";
import "../css/HomeHeader.css";

class HomeHeader extends Component {
  render() {
    return (
      <div className="HomeHeader">
        <header className="home-header">
          <h1 className="App-logo">XPERTCUBE REACT WEBSITE</h1>
          <h2 className="App-header-title"><a class="weatherwidget-io" href="https://forecast7.com/en/10d8876d11/kodumudi/" data-label_1="KODUMUDI" data-label_2="WEATHER" data-theme="original" data-basecolor="" >KODUMUDI WEATHER</a></h2>
        </header>
      </div>
    );
  }
}

export default HomeHeader;
